import React from "react";
import PropTypes from 'prop-types';

function Images({src, alt}) {
    return (
        <img class="card-img-top" src={src} alt={alt} style={{ background: 'silver', color: '#ffffff', fontSize: "18px", whiteSpace: 'nowrap', width: '300px', height: "200px"}} /> 
    )
}

Images.propTypes = {
    src: PropTypes.string,
    alt: PropTypes.string
}
export default Images;
